const UploadFile = async () => {
var myHeaders = new Headers();
myHeaders.append("", "");

var raw = "";
var url="uploadFileName"
var requestOptions = {
  method: 'POST',
  headers: myHeaders,
  body: raw,
  redirect: 'follow'
};

fetch("http://localhost:7000/uploadfile/obj.txt", requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));

}

export default UploadFile;
